L,'6980bc8f-b5c7-4ccd-b3ae-2cffffec4c38'),(55,2501,'Depo (Rx 150mg IMx1): Administer at discharge. <br>\nPatient may get irregular or decreased menses.<br>\nRefill at HP in 3months.<br>\nCOC (combination progesterone and estrogen): Do NOT use while breastfeeding<br>','en',1,'2015-05-26 14:09:03',NULL,NULL,'c1d9f1cd-cc9d-4176-b059-c2a133ebd3e4'),(56,2503,'Condoms (dispense 40): these also protect against STIs<br>\nDepo (Rx 150mg IMx1): Administer at discharge. <br>\nPatient may get irregular or decreased menses<br>\nCOC (combination progesterone and estrogen): Do NOT use while breastfeeding<br>','en',1,'2015-05-26 14:09:03',NULL,NULL,'0ce19982-e3cd-42c8-aae8-5c2f4f941ef9'),(57,2504,'Encourage patient to use condoms, COC or Depo while they wait to get one of the below procedures done<br>\n- IUCD: Works for 12 years and is available at private pharmacy clinic or Mangelsen<br>\n- Implant: Works for 5 years, available at Mangelsen<br>\n- Mini-lap: Permanent for women<br>\n- Vasectomy: Permanent for men<br>','en',1,'2015-05-26 14:09:03',NULL,NULL,'ce66631a-5937-4597-b3b6-b62e330352bf'),(58,2527,'- Greater than 3 months presence of kidney damage (usually detected as urinary albumin excretion of more than 30 mg/day, or equivalent)<br>\n- decreased kidney function (defined as estimated glomerular filtration rate [eGFR] less than 60 mL/min per 1.73 m2)<br>','en',1,'2015-05-26 14:25:52',NULL,NULL,'70f445c3-76a0-4248-bb72-c0c1aef99686'),(59,2532,'- Glomerular diseases (diabetes, autoimmune diseases, systemic infections, drugs, neoplasia).<br>\n- Vascular diseases (atherosclerosis, hypertension, ischemia, vasculitis, thrombotic microangiopathy).<br>\n- Tubulointerstitial diseases (urinary tract infections, stones, obstruction, drug toxicity).<br>\n- Cystic disease (polycystic kidney disease).<br>','en',1,'2015-05-26 14:25:52',NULL,NULL,'1ed48ccf-e9da-4a2b-9c6a-85c2f4e26a6f'),(60,2536,'Cortical scarring due to infarcts, pyelonephritis or vesicoureteral reflux','en',1,'2015-05-26 14:25:53',NULL,NULL,'c4254f90-a405-471d-ad29-e67f6b5ce673'),(61,2537,'Renal masses or enlarged kidneys due to infiltrative diseases','en',1,'2015-05-26 14:25:53',NULL,NULL,'c4c32a58-ee83-442c-8296-40ff38032d23'),(62,2538,'Small and echogenic kidneys (common in later stages of CKD due to many parenchymal diseases)','en',1,'2015-05-26 14:25:53',NULL,NULL,'d9e2be2c-8f47-4dfc-8adf-dd64f945116b'),(63,2559,'<strong>Cockroft - Gault equation</strong> <br> \nMale   [1.23Xweight x (140-age) ] /creatinine <br>\nFemale [1.08Xweight x (140-age) ] /creatinine <br>\n<em>Calculator for GFR can be found at http://egfrcalc.renal.org/</em><br>\n<ul>\n<li> <strong>G1   </strong>GFR>90: Normal or high</li>\n<li><strong>G2   </strong>GFR 60 to 89: Mildly decreased</li>\n<li><strong>G3a </strong>GFR 45 to 59: Mildly to moderately decreased</li>\n<li><strong>G3b </strong>GFR 30 to 44: Moderately to severely decreased</li>\n<li><strong>G4   </strong>GFR 15 to 29: Severely decreased</li>\n<li><strong>G5   </strong>GFR<15: Kidney failure (add D if treated by dialysis)</li>\n</ul>','en',1,'2015-05-26 14:28:35',NULL,NULL,'6ea19889-280b-40c0-ace1-08349b7ed4f3'),(64,2564,'If yes, start furosemide 20mg po bid after confirming there is no hypokalemia (low K)<br>','en',1,'2015-05-26 14:28:36',NULL,NULL,'e62c8db6-1ad3-4e7b-9c4f-24d3cdae1816'),(65,2566,'Should check istat q3months if on diuretics and if not on diuretics q6 months to trend Cr<br>','en',1,'2015-05-26 14:28:36',NULL,NULL,'a0779b45-67d7-40f5-b724-d47cf1950d04'),(66,2567,'Enalapril 5mg po daily for stage 2 CKD or worse<br>','en',1,'2015-05-26 14:28:36',NULL,NULL,'3097375f-c5b5-4dd2-8f96-99270eb4b1d7'),(67,2581,'Dyspnea<br>Sputum<br>Chronic cough >3 months in 2 successive years <br>Wheezing<br>Chest tightness','en',1,'2015-05-26 14:30:24',NULL,NULL,'ba6e7673-e6a3-4721-a154-f1a65ad1a172'),(68,2583,'<b>CXR features</b><br>- Increased radiolucency of the lung, a flat diaphragm<br>- Bullae, defined as radiolucent areas larger than one centimeter<br>- advanced disease → cardiac shadow enlarged due to pulmonary hypertension and cor pulmonale','en',1,'2015-05-26 14:30:24',NULL,NULL,'4513c058-f753-42f8-9648-40a9df07770d'),(69,2607,'1 - I only get breathless with strenuous exercise.<br>\n\n\n		2 - Short of breath hurrying on flat ground/walking up a slight hill.<br>\n\n\n		3 - Flat ground - I walk slower than people of the same age because of breathlessness, or have to stop for breath when walking at my own pace.<br>\n\n\n		4 - Stop for breath after walking 100m or after a few min flat ground.<br>\n\n	\n       	5 - I am too breathless to leave the house /breathless when dressing.<br>','en',1,'2015-05-26 14:31:48',NULL,NULL,'40ed6e74-fb3c-4240-aae1-e43b65b16ea6'),(70,2614,'<li>Location</li>\n\n	<li>Severity</li>\n\n	<li>Quality</li>\n\n	<li>Timing : Constant / Intermittent, how long did it last</li>\n\n	<li>Duration : When did it Start</li>\n\n	<li>Modifying Factors : Anything make it better or worse</li>\n\n	<li>Context : What were you doing when it started</li>\n\n	<li>Associated Signs or Symptoms</li>','en',1,'2015-05-26 14:36:57',NULL,NULL,'50729d6b-e741-4cbb-8867-2a13c00819ca'),(71,2628,'.','en',1,'2015-05-26 14:36:58',NULL,NULL,'25c6bcb5-12a5-4e04-a98e-6bc2b5ac6185'),(72,2715,'Cigarettes/day or Packs/day? Years?','en',1,'2015-05-26 14:37:02',NULL,NULL,'b3e2fa58-bb9c-4259-bb51-951abfc145ee'),(73,2717,'Drinks/day, Type of Alcohol','en',1,'2015-05-26 14:37:02',NULL,NULL,'8403b709-c72d-49d3-88cd-c1498861e8ff'),(74,2718,'CAGE Questionnaire<br>\nHave you ever felt you needed to Cut down on your drinking?<br>\nHave people Annoyed you by criticizing your drinking?<br>\nHave you ever felt Guilty about drinking?<br>\nHave you ever felt you needed a drink first thing in the morning (Eye-opener) to steady your nerves or to get rid of a hangover?','en',1,'2015-05-26 14:37:02',NULL,NULL,'93d3bc15-a276-41e1-b6be-46ca2c579ff2'),(75,2720,'General <br>\nHEENT<br>\nCV<br>\nLungs<br>\nAbdomen<br>\nMSK<br>\nSkin<br>\nNeuro <br>\nPsych<br>','en',1,'2015-05-26 14:37:02',NULL,NULL,'e75928f1-2f04-4713-b958-de0e81e27bfa'),(76,2725,'Most likely diagnosis and other differential diagnosis (space for 2-3 others)<br>\nStable, unstable, improved / worse / same<br>\nPatient counseling and education on ____<br>\nDiagnostic plan and orders<br>\nMedication plan and prescription<br>','en',1,'2015-05-26 14:37:02',NULL,NULL,'1a5f9bee-f91e-4771-a2ba-e33fef5e193d'),(77,2728,'If more than 2 consider step-up current therapy to next level of treatment','en',1,'2015-05-26 14:37:03',NULL,NULL,'cf79cbec-7396-4010-8b0c-8d34fdb97bb1'),(78,2729,'If patient using more than  2 days / week, consider step-up therapy to next level of treatment','en',1,'2015-05-26 14:37:03',NULL,NULL,'d551bbfb-94b3-4df9-8c5d-87d1e3270b33'),(79,2730,'If 1-3x/ week consider step-up therapy to next level of treatment','en',1,'2015-05-26 14:37:03',NULL,NULL,'80cb6d0f-f777-4a7f-87ac-bb9c770f8d32'),(80,2736,'<ul>\n<li><b>Intermittent</b>:  Daytime asthma symptoms occurring two or fewer days per week - Two or fewer nocturnal awakenings per month</li>\n<li><b>Mild persistent</b>: Symptoms more than twice weekly (although less than daily) - Three to four nocturnal awakenings per month due to asthma.</li>\n<li><b>Moderate persistent</b>: Daily symptoms of asthma - Nocturnal awakenings > than once per week</li>\n<li><b>Severe persistent</b>: Symptoms of asthma throughout the day - Nocturnal awakenings nightly</li>\n<li><b>Severe asthma</b>: Symptoms not controlled by above treatment.</li>\n</ul>','en',1,'2015-05-26 14:37:03',NULL,NULL,'31cc3564-e1f0-4ccd-9f7e-a6243f03eddc'),(81,2746,'Are the other medical problems controlled','en',1,'2015-05-26 14:37:05',NULL,NULL,'95a2cfbf-f3f5-46a2-b962-54e2e5be2a24'),(82,2751,'<b>Class I</b> - symptoms of HEART FAILURE only at activity levels that would limit normal individuals<br/>\n<b>Class II</b> - symptoms of HEART FAILURE with ordinary exertion<br/>\n<b>Class III</b> - symptoms of HEART FAILURE with less than ordinary exertion<br/>\n<b>Class IV</b> - symptoms of HEART FAILURE at rest','en',1,'2015-05-26 14:37:05',NULL,NULL,'d7e9e235-dd06-454d-9f34-278239990141'),(83,2754,'Baseline and then q12 months unless symptoms of chest pain','en',1,'2015-05-26 14:37:05',NULL,NULL,'9ee9def1-7797-4603-942b-feacafce0e05'),(84,2757,'Atenolol and nitrates are first-line treatment for angina','en',1,'2015-05-26 14:37:05',NULL,NULL,'72dc0ee5-c8d1-4272-bde1-926d8d5a3a42'),(85,2761,'All patient w/ CAD should be on at least 20mg atorvastatin or 40mg','en',1,'2015-05-26 14:37:05',NULL,NULL,'645b0ebb-3693-4822-b616-109c4f840c4e'),(86,2763,'All patients with CAD should be on low-dose aspirin for prevention unless a contraindication exists','en',1,'2015-05-26 14:37:05',NULL,NULL,'d1c36d47-29fd-405f-a481-1fd5d745b36c'),(87,2764,'Meet all 5 of the following\n	<li>Inflammatory arthritis involving three or more joints</li>\n	<li>Duration of symptoms is more than six weeks.</li>\n	<li>Positive rheumatoid factor (RF)</li>\n	<li>Elevated levels of C-reactive protein (CRP) or the erythrocyte sedimentation rate (ESR)</li>\n	<li>Diseases with similar clinical features have been excluded (crystal dz, lupus, psoriatic)</li>','en',1,'2015-05-26 14:37:05',NULL,NULL,'d707bfce-c68a-4c58-80d7-2784b22977ee'),(88,2765,'Meet all 3 of the below:\n	<li>Presence of inflammation in at least one joint</li>\n	<li>The absence of an alternative diagnosis that better explains the joint inflammation</li>\n	<li>Achievement of a total score of at least 6</li>','en',1,'2015-05-26 14:37:05',NULL,NULL,'3ffa052a-7008-4b82-b636-c83cd28ecc95'),(89,2766,'<li><strong>1</strong> Point - 2 to 10 large joints \nfrom among shoulders, elbows, hips, knees, and ankles)</li>\n\n	<li><strong>2</strong> Points - 1 to 3 small joints \n(from among the metacarpophalangeal joints, proximal interphalangeal\njoints, second through fifth metatarsophalangeal joints, thumb \ninterphalangeal joints, and wrists</li>\n\n	<li><strong>3</strong> Points - 4 to 10 small joints</li>\n\n	<li><strong>5</strong> Points - Greater than 10 joints (including at least 1 small joint)</li>','en',1,'2015-05-26 14:37:06',NULL,NULL,'c9bb164d-26f3-469f-89c0-1773a2ceb4e8'),(90,2767,'Serological abnormality (rheumatoid factor)\n	<li><strong>0 </strong>Point  – If Negative</li>\n	<li><strong>3</strong> Points – If Positive</li>','en',1,'2015-05-26 14:37:06',NULL,NULL,'3b5a0e2f-b485-4bd1-aac1-0172f46dc460'),(91,2768,'Elevated acute phase response (erythrocyte sedimentation rate [ESR]<br>\nor C-reactive protein [CRP]) above the ULN<br>\n	<li><strong>0</strong> Point – Both Not Raised</li>\n	<li><strong>1 </strong>Point – At Least One Raised</li>','en',1,'2015-05-26 14:37:06',NULL,NULL,'68f9f88a-f1ef-4297-843b-db0acb9afa0a'),(92,2769,'Symptom Duration\n	<li><strong>0</strong> Point – Less than 6 Weeks</li>\n	<li><strong>1</strong> Point – Greater than equal to 6 Weeks</li>','en',1,'2015-05-26 14:37:06',NULL,NULL,'2dbd0da9-c0f9-416c-a64c-c9b7c9759f51'),(93,2772,'Pain control -- NSAIDs: paracetamol 500mg po qid, and/or ibuprofen 400mg po tid.<br>\nAcute flare w/ evidence of joint swelling or effusions -- prednisolone 10mg po daily x 7 days.<br>\n** STOP prednisone and NSAIDs when disease control is achieved.<br>','en',1,'2015-05-26 14:37:06',NULL,NULL,'c5750ef4-4c2b-4535-b485-10cb36159000'),(94,2773,'CONTRAINDICATIONS  pregnant, breast-feeding, patients with liver disease or alcohol intake, <br>\nrenal impairment, immunodeficiency syndrome<br>','en',1,'2015-05-26 14:37:06',NULL,NULL,'4133ed67-0b12-4fa6-80f3-980f9e81dc47'),(95,2774,'if yes, patients with resultant CHF or valve damage should be on lifelong penicillin, SEE BELOW for dosing regimen','en',1,'2015-05-26 14:37:06',NULL,NULL,'cd454025-90a3-4e9f-8652-ae9c9916c487'),(96,2775,'- Class I — symptoms of HEART FAILURE only at activity levels that would limit normal individuals<br>\n- Class II — symptoms of HEART FAILURE  with ordinary exertion<br>\n- Class III — symptoms of HEART FAILURE